    "        Dropout(dropout_rate),\n",
    "        Dense(1, kernel_regularizer=l2(0.01))  # L2 regularization\n",
    "    ])\n",
    "    model.compile(optimizer='adam', loss='mean_squared_error')\n",
    "    return model\n",
    "\n",
