    "    plt.plot(dates[len(y_train):], y_test, label=\"Actual Test Spot Rate\", color='green')\n",
    "    plt.plot(dates[len(y_train):], test_predictions, label=\"Test Predictions\", color='orange', linestyle='--')\n",
